import{_ as e,e as a}from"./app.6c6fd354.js";const t={},n=a('<h1 id="dimension-management" tabindex="-1"><a class="header-anchor" href="#dimension-management" aria-hidden="true">#</a> Dimension Management</h1><h3 id="dynamically-adding-and-removing-dimensions" tabindex="-1"><a class="header-anchor" href="#dynamically-adding-and-removing-dimensions" aria-hidden="true">#</a> Dynamically Adding and Removing Dimensions</h3><p>The latest version of this mod has the functionality of dynamically adding and removing dimensions when the game is running.</p><p><strong>This feature is still experimental.</strong></p><p>Example: command <code>/dims clone_dimension minecraft:overworld &quot;aaa:bbb&quot;</code> dynamically adds new dimension <code>aaa:bbb</code> that has the same world generation as the overworld. Command <code>/dims remove_dimension aaa:bbb</code> can remove it.</p><p><a href="./Commands-Reference#dimension-management-commands">See Also</a></p><h3 id="alternate-dimensions" tabindex="-1"><a class="header-anchor" href="#alternate-dimensions" aria-hidden="true">#</a> Alternate Dimensions</h3><p>This mod provides 5 alternate dimensions for dimension stack:</p><table><thead><tr><th>Name</th><th>Dimension id</th><th>Description</th></tr></thead><tbody><tr><td>Skyland1</td><td>immersive_portals:alternate1</td><td>Skyland with overworld biome distribution</td></tr><tr><td>Skyland2</td><td>immersive_portals:alternate2</td><td>Same as alternate1, but with a different seed</td></tr><tr><td>Chaos1</td><td>immersive_portals:alternate3</td><td>Full of crazy world generation errors</td></tr><tr><td>Chaos2</td><td>immersive_portals:alternate4</td><td>Same as alternate3</td></tr><tr><td>Void</td><td>immersive_portals:alternate5</td><td>Void</td></tr></tbody></table><p>Alternate dimensions can be disabled via config.</p>',10);function d(i,r){return n}var s=e(t,[["render",d],["__file","Dimension-Management.html.vue"]]);export{s as default};
